//Function Name: putPCX256
//Input: x,y
//Description: display the 256 color pcx
//注意，这种显示方法速度有点慢，采用fast函数较好
VOID putPCX256(UINTN x,UINTN y)
{
	UINT32 index,count;
	UINT16 num_bytes;
	UINT8 pcxdata;
	UINTN putX,putY;
	
	index=0;	//图像数据的指针
	count=0;	//用来定位像素位置的计数器
	//压缩区数据处理
	while(count<=(((UINT32)gSYPCX_Width) * ((UINT32)gSYPCX_Height)))
	{
		// get the first piece of data
		pcxdata = gSYPCXPicture[index];
		++index;
		// is this a rle?
		if(pcxdata>=192)
		{
			// how many bytes in run?
			num_bytes = pcxdata-192;
			// get the actual data for the run
			pcxdata  = gSYPCXPicture[index];;
			++index;
			// replicate data in buffer num_bytes times
			while(num_bytes-->0)
			{
				putX=x+(count%gSYPCX_Width);
				putY=y+(count/gSYPCX_Width);
				putpixel(putX,putY,&(gSYPCXColorTable[pcxdata]));
				++count;
			} // end while
		} // end if rle
		else
		{
			// actual data, just copy it into buffer at next location
			putX=x+(count%gSYPCX_Width);
			putY=y+(count/gSYPCX_Width);
			putpixel(putX,putY,&(gSYPCXColorTable[pcxdata]));
			++count;
		} // end else not rle
	} // end while 
}

